import React from "react";
import styled from "styled-components";

export default function Header(props) {
  return (
    <Nav>
      <Logo>
        <img src="/images/logo.svg" />
      </Logo>
      Header
    </Nav>
  );
}

const Nav = styled.nav`
  position: fixed;
  top: 0;
  right: 0;
  left: 0;
  height: 70px;
  background-color: #090b13;
  display: flex;
  flex-direction: row;
  justify-content: space-between;
  align-items: center;
  padding: 0 36px;
  letter-spacing: 10px;
  z-index: 3;
`;

const Logo = styled.a`
  padding: 5px;
  width: 80px;
`;
